import React from 'react';
import {MenuItem} from './menu_items';
import './navbar.css'



class Navbar extends React.Component{
  state ={clicked:false}

  handleClick = ()=>{
    this.setState({ clicked: !this.state.clicked})
  }
  render(){
    return(
      <nav className="NavbarItems navbar navbar-expand-xl navbar-dark">
        <div className="menu-icon" onClick={this.handleClick}>
          <i className={this.state.clicked? 'fas fa-times':
          'fas fa-bars'}></i>
        </div>
        <button class="navbar-toggler collapsed" type="button" data-toggle="collapse" data-target="#navbarSupportedContent1"
         aria-controls="navbarSupportedContent1 ">
         <i className={this.state.clicked? 'fas fa-times':
         'fas fa-bars'}></i>
         </button>
         <div class="collapse navbar-collapse" id="navbarSupportedContent1">
        <ul className={this.state.clicked ?'nav-menu active':
        'nav-menu'}>
        {MenuItem.map((item,index) => {
          return(
            <li key={index}>
              <a className={item.cName} href={item.url}>
              {item.name}
              </a>
            </li>
          )
        })}
        </ul>
        </div>
      </nav>
    )
  }
}

export default Navbar
